webpackJsonp([0x8b3067b5be85],{634:function(e,a){e.exports={data:{markdownRemark:{html:'<h3>Retesting Bundles</h3>\n<p>Programs can now opt-in to purchase a bundle of retests with their HackerOne subscription. With bundles, programs are no longer charged the processing fee for each bounty, and can also opt-in to purchase more retests when they run out. </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/feb_2019_retesting_bundles-c94d80d13cd9cce8bdd6077bc8a60066-9ed78.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 16.6883963494133%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Retesting Bundles"\n        title=""\n        src="/static/feb_2019_retesting_bundles-c94d80d13cd9cce8bdd6077bc8a60066-2f183.png"\n        srcset="/static/feb_2019_retesting_bundles-c94d80d13cd9cce8bdd6077bc8a60066-67829.png 125w,\n/static/feb_2019_retesting_bundles-c94d80d13cd9cce8bdd6077bc8a60066-5c59f.png 250w,\n/static/feb_2019_retesting_bundles-c94d80d13cd9cce8bdd6077bc8a60066-2f183.png 500w,\n/static/feb_2019_retesting_bundles-c94d80d13cd9cce8bdd6077bc8a60066-c93e8.png 750w,\n/static/feb_2019_retesting_bundles-c94d80d13cd9cce8bdd6077bc8a60066-4e628.png 1000w,\n/static/feb_2019_retesting_bundles-c94d80d13cd9cce8bdd6077bc8a60066-b3ac4.png 1500w,\n/static/feb_2019_retesting_bundles-c94d80d13cd9cce8bdd6077bc8a60066-9ed78.png 1534w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>My Programs</h3>\n<p>We’ve renamed the Accepted Invitations page on the Hacker Dashboard to now be called My Programs. We’ve also revamped the page so that hackers can better manage the all of the programs they’re a part of by including:</p>\n<ul>\n<li>More filtering options</li>\n<li>Sorting</li>\n<li>A search bar</li>\n<li>A <em>My stats</em> section for each program where hackers can see their personal statistics for the program</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/feb_2019_my_programs-d380e376f0d8ae056fe048c47de81eba-5a225.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.71340333539222%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="My Programs"\n        title=""\n        src="/static/feb_2019_my_programs-d380e376f0d8ae056fe048c47de81eba-2f183.png"\n        srcset="/static/feb_2019_my_programs-d380e376f0d8ae056fe048c47de81eba-67829.png 125w,\n/static/feb_2019_my_programs-d380e376f0d8ae056fe048c47de81eba-5c59f.png 250w,\n/static/feb_2019_my_programs-d380e376f0d8ae056fe048c47de81eba-2f183.png 500w,\n/static/feb_2019_my_programs-d380e376f0d8ae056fe048c47de81eba-c93e8.png 750w,\n/static/feb_2019_my_programs-d380e376f0d8ae056fe048c47de81eba-4e628.png 1000w,\n/static/feb_2019_my_programs-d380e376f0d8ae056fe048c47de81eba-b3ac4.png 1500w,\n/static/feb_2019_my_programs-d380e376f0d8ae056fe048c47de81eba-5a225.png 1619w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Overview</h3>\n<p>We\'ve renamed the Getting Started page to now be called Overview. We provide new hackers that haven\'t submitted any vulnerabilities with a getting started checklist with 4 tasks to complete to guide them to be more successful on the platform.    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/feb_2019_hackerdashboard_checklist-7b69ede3c28fea4f77e15f8a7ff61f99-3feb6.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 65.82537517053207%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Hacker Dashboard Checklist"\n        title=""\n        src="/static/feb_2019_hackerdashboard_checklist-7b69ede3c28fea4f77e15f8a7ff61f99-2f183.png"\n        srcset="/static/feb_2019_hackerdashboard_checklist-7b69ede3c28fea4f77e15f8a7ff61f99-67829.png 125w,\n/static/feb_2019_hackerdashboard_checklist-7b69ede3c28fea4f77e15f8a7ff61f99-5c59f.png 250w,\n/static/feb_2019_hackerdashboard_checklist-7b69ede3c28fea4f77e15f8a7ff61f99-2f183.png 500w,\n/static/feb_2019_hackerdashboard_checklist-7b69ede3c28fea4f77e15f8a7ff61f99-c93e8.png 750w,\n/static/feb_2019_hackerdashboard_checklist-7b69ede3c28fea4f77e15f8a7ff61f99-4e628.png 1000w,\n/static/feb_2019_hackerdashboard_checklist-7b69ede3c28fea4f77e15f8a7ff61f99-3feb6.png 1466w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Hacker Statistics</h3>\n<p>After hackers have submitted their first vulnerability, they\'ll be able to view statistics for these personal metrics on their Overview page:</p>\n<ul>\n<li>Number of valid reports  </li>\n<li>Bounties earned</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/feb_2019_hackerdashboard_statistics-10b6ba1bffd5667f421dd481a5bf0b50-3feb6.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 57.912687585266035%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Hacker Dashboard Statistics"\n        title=""\n        src="/static/feb_2019_hackerdashboard_statistics-10b6ba1bffd5667f421dd481a5bf0b50-2f183.png"\n        srcset="/static/feb_2019_hackerdashboard_statistics-10b6ba1bffd5667f421dd481a5bf0b50-67829.png 125w,\n/static/feb_2019_hackerdashboard_statistics-10b6ba1bffd5667f421dd481a5bf0b50-5c59f.png 250w,\n/static/feb_2019_hackerdashboard_statistics-10b6ba1bffd5667f421dd481a5bf0b50-2f183.png 500w,\n/static/feb_2019_hackerdashboard_statistics-10b6ba1bffd5667f421dd481a5bf0b50-c93e8.png 750w,\n/static/feb_2019_hackerdashboard_statistics-10b6ba1bffd5667f421dd481a5bf0b50-4e628.png 1000w,\n/static/feb_2019_hackerdashboard_statistics-10b6ba1bffd5667f421dd481a5bf0b50-3feb6.png 1466w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{path:"/changelog/2019/february",title:"February 2019"}}},pathContext:{}}}});
